B.Hr=new A.ff("eco","Eco Shop mobile app","UX/UI Design- Design System","This project was motivated by my commitment with the environment.  What we consume affects the planet and our health so this freelance work was my contribution to the cause.\n          \nThe objective with this design was to build for our client an eco shop mobile app to attend the needs of their consumers in the purchase of their products quickly and efficently.\n          \nI use the Design Thinking method form the start till the end of the complete process.\n          \nUX Research and Usability Testings were the key to build this product.  Also, I create a Design System with guideliness in order to make a more consitent UI.","https://www.behance.net/gallery/147033339/UX-Design-Eco-Shop-app","cover.webp",B.dL,B.E6,!0)
